import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Button,
  TextField,
  Alert,
  CircularProgress
} from '@mui/material';
import { MapContainer, TileLayer, Marker, Popup, useMapEvents } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Fix for default markers in react-leaflet
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const MapClickHandler = ({ onLocationSelect }) => {
  useMapEvents({
    click: (e) => {
      const { lat, lng } = e.latlng;
      
      // Simple reverse geocoding using Nominatim (free)
      fetch(`https://nominatim.openstreetmap.org/reverse?format=json&lat=${lat}&lon=${lng}&addressdetails=1`)
        .then(response => response.json())
        .then(data => {
          const address = data.display_name || 'Adresa nu a putut fi determinată';
          const locationName = data.name || data.display_name?.split(',')[0] || 'Locație selectată';
          
          onLocationSelect({
            name: locationName,
            address: address,
            lat: lat,
            lng: lng
          });
        })
        .catch(error => {
          console.error('Geocoding error:', error);
          // Fallback with coordinates only
          onLocationSelect({
            name: `Locație (${lat.toFixed(4)}, ${lng.toFixed(4)})`,
            address: `Coordonate: ${lat.toFixed(6)}, ${lng.toFixed(6)}`,
            lat: lat,
            lng: lng
          });
        });
    }
  });
  return null;
};

const OpenStreetMapLocationPicker = ({ open, onClose, onLocationSelect, initialLocation }) => {
  const [loading, setLoading] = useState(false);
  const [mapError, setMapError] = useState(false);

  const handleLocationSelect = (location) => {
    setLoading(true);
    setTimeout(() => {
      onLocationSelect(location);
      setLoading(false);
    }, 500);
  };

  if (!open) return null;

  return (
    <Box
      sx={{
        position: 'fixed',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        backgroundColor: 'rgba(0, 0, 0, 0.5)',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        zIndex: 9999
      }}
    >
      <Box
        sx={{
          backgroundColor: 'white',
          borderRadius: 2,
          padding: 3,
          maxWidth: '90vw',
          maxHeight: '90vh',
          width: '800px',
          overflow: 'auto'
        }}
      >
        <Typography variant="h5" gutterBottom>
          Selectați Locația pe Hartă
        </Typography>
        <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
          Faceți clic pe hartă pentru a selecta locația evenimentului (OpenStreetMap - gratuit)
        </Typography>
        
        {mapError ? (
          <Box textAlign="center" py={4}>
            <Alert severity="error" sx={{ mb: 2 }}>
              Nu s-a putut încărca harta. Vă rugăm să introduceți manual locația.
            </Alert>
            <ManualLocationInput onLocationSelect={handleLocationSelect} />
          </Box>
        ) : (
          <Box sx={{ height: '400px', width: '100%', position: 'relative' }}>
            {loading && (
              <Box
                sx={{
                  position: 'absolute',
                  top: 0,
                  left: 0,
                  right: 0,
                  bottom: 0,
                  backgroundColor: 'rgba(255, 255, 255, 0.8)',
                  display: 'flex',
                  justifyContent: 'center',
                  alignItems: 'center',
                  zIndex: 1000
                }}
              >
                <CircularProgress />
                <Typography variant="body2" sx={{ ml: 2 }}>
                  Se procesează locația...
                </Typography>
              </Box>
            )}
            
            <MapContainer
              center={initialLocation ? [initialLocation.lat, initialLocation.lng] : [44.4268, 26.1025]} // Bucharest
              zoom={13}
              style={{ height: '100%', width: '100%' }}
              onError={() => setMapError(true)}
            >
              <TileLayer
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              />
              {initialLocation && (
                <Marker position={[initialLocation.lat, initialLocation.lng]}>
                  <Popup>
                    {initialLocation.name}
                  </Popup>
                </Marker>
              )}
              <MapClickHandler onLocationSelect={handleLocationSelect} />
            </MapContainer>
          </Box>
        )}

        <Box display="flex" gap={2} sx={{ mt: 2 }}>
          <Button
            variant="contained"
            onClick={() => onLocationSelect(null)}
            disabled={loading}
          >
            Anulează
          </Button>
        </Box>
      </Box>
    </Box>
  );
};

const ManualLocationInput = ({ onLocationSelect }) => {
  const [formData, setFormData] = useState({
    name: '',
    address: '',
    lat: '',
    lng: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    if (formData.name && formData.address && formData.lat && formData.lng) {
      onLocationSelect({
        name: formData.name,
        address: formData.address,
        lat: parseFloat(formData.lat),
        lng: parseFloat(formData.lng)
      });
    }
  };

  return (
    <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
      <Typography variant="h6" gutterBottom>
        Introduceți manual locația
      </Typography>
      <TextField
        fullWidth
        label="Numele locației"
        value={formData.name}
        onChange={(e) => setFormData({ ...formData, name: e.target.value })}
        margin="normal"
        required
      />
      <TextField
        fullWidth
        label="Adresa completă"
        value={formData.address}
        onChange={(e) => setFormData({ ...formData, address: e.target.value })}
        margin="normal"
        required
      />
      <Box display="flex" gap={2}>
        <TextField
          fullWidth
          label="Latitudine"
          type="number"
          value={formData.lat}
          onChange={(e) => setFormData({ ...formData, lat: e.target.value })}
          margin="normal"
          required
        />
        <TextField
          fullWidth
          label="Longitudine"
          type="number"
          value={formData.lng}
          onChange={(e) => setFormData({ ...formData, lng: e.target.value })}
          margin="normal"
          required
        />
      </Box>
      <Button type="submit" variant="contained" sx={{ mt: 2 }}>
        Confirmă Locația
      </Button>
    </Box>
  );
};

export default OpenStreetMapLocationPicker;
